  return(
      <div className="user">
          {props.username}
          {props.age}
          {props.image}
      </div>
  )
}

function App() {

  const userObj = { name: "bernard", age: 21, dp : "jjj.jpg" }

  return (
    <div className="container">
      <UserInfo username={name} age={userObj.age} image={userObj.dp}/>
    </div>
  );
}

export default App;
